use iThings;
create table sys_tenant_app_menu
(
    template_id  bigint                                   not null,
    tenant_code  varchar(50)                              not null,
    app_code     varchar(50)                              not null,
    id           bigint auto_increment
        primary key,
    module_code  varchar(50)                              not null,
    parent_id    bigint      default 1                    not null,
    type         bigint      default 1                    not null,
    order_num    bigint      default 1                    not null,
    name         varchar(50)                              not null,
    path         varchar(64)                              not null,
    component    varchar(1024)                            not null,
    icon         varchar(64)                              not null,
    redirect     varchar(64)                              not null,
    body         varchar(1024)                            null,
    hide_in_menu bigint      default 2                    not null,
    created_time datetime(3) default current_timestamp(3) not null,
    updated_time datetime(3) default current_timestamp(3) not null,
    deleted_time bigint      default 0                    null,
    created_by   bigint                                   null,
    deleted_by   bigint                                   null,
    updated_by   bigint                                   null,
    `order`      bigint      default 1                    not null,
    is_common    bigint      default 2                    null
)
    charset = utf8mb3;

create index idx_sys_tenant_app_menu_created_time
    on sys_tenant_app_menu (created_time);

create index idx_sys_tenant_app_menu_deleted_time
    on sys_tenant_app_menu (deleted_time);

